import React, { useEffect, useState } from 'react';

const WeeklyScoresPage = () => {
  const [games, setGames] = useState([]);

  useEffect(() => {
    fetch('http://localhost:4000/data/weekly_results.json')
      .then(res => res.json())
      .then(data => setGames(data))
      .catch(() => setGames([]));
  }, []);

  return (
    <div style={{ padding: '30px', maxWidth: '800px', margin: 'auto', fontFamily: 'Arial, sans-serif' }}>
      <h2>Weekly Scores</h2>
      <p>Here are the final scores for this weekâ€™s games:</p>

      {games.length === 0 ? (
        <p>No score data available yet. Please check back later.</p>
      ) : (
        <ul style={{ fontSize: '18px', lineHeight: '1.8' }}>
          {games.map((game, index) => (
            <li key={index}>
              {game.team1} ({game.score1}) &nbsp;&nbsp;&nbsp; {game.team2} ({game.score2})
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default WeeklyScoresPage;
